import React, { useState } from 'react';
import { Container, TextField, Button, Typography, Box, IconButton } from '@mui/material';
import { ArrowBack } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import config from '../../config';

const UserManagementRegister = () => {
  const [formData, setFormData] = useState({
    email: '',
    firtName: '',
    lastName: ''
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      console.log(formData)
      const response = await axios.post(`${config.API_URL}/usuario/registrarUsuario`, formData, {
        withCredentials: true,
      });
      console.log('User registered:', response.data);
      navigate('/dashboard/user-management'); // Redirige a la vista de gestión de usuarios después del registro
    } catch (error) {
      console.error('Error registering user:', error);
    }
  };

  const handleBack = () => {
    navigate('/dashboard/user-management');
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
        <IconButton onClick={handleBack}>
          <ArrowBack />
        </IconButton>
        <Typography variant="h4">Registrar Usuario</Typography>
      </Box>
      <Box component="form" onSubmit={handleSubmit} sx={{ mt: 2 }}>
        <TextField
          label="Email"
          name="email"
          value={formData.email}
          onChange={handleChange}
          variant="outlined"
          fullWidth
          margin="normal"
          required
        />
        <TextField
          label="First Name"
          name="firtName"
          value={formData.firtName}
          onChange={handleChange}
          variant="outlined"
          fullWidth
          margin="normal"
          required
        />
        <TextField
          label="Last Name"
          name="lastName"
          value={formData.lastName}
          onChange={handleChange}
          variant="outlined"
          fullWidth
          margin="normal"
          required
        />
        <Button type="submit" variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>
          Guardar cambios
        </Button>
      </Box>
    </Container>
  );
};

export default UserManagementRegister;
